import WritingCard from "../components/WritingCard";

export default function Writing() {
  const articles = [
    { title: "Finding My Style", link: "#" },
    { title: "The Process of Creation", link: "#" },
    // add more
  ];

  return (
    <section className="writing">
      <h2>Writing</h2>
      <ul>
        {articles.map((a, i) => (
          <WritingCard key={i} article={a} />
        ))}
      </ul>
    </section>
  );
}
